<span class="line"><span style="color:#BABED8;">ws</span><span style="color:#89DDFF;">.</span><span style="color:#82AAFF;">send</span><span style="color:#BABED8;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">heart_beat</span><span style="color:#89DDFF;">&#39;</span><span style="color:#BABED8;">)</span></span>
